import React from 'react'
import img1 from '../src/images/img3.svg'
const Sdata = [
    {
        img : {img1},
        title : "Card Details",
        text : "Some quick example text to build on the card title and make up the bulk of the card's content.",
        buttonText : "Read More",
    },
    {
        img : {img1},
        title : "Card Details",
        text : "Some quick example text to build on the card title and make up the bulk of the card's content.",
        buttonText : "Read More"
    }
]
export default Sdata;
